import { FETCH_LATEST_PLAYERS, FETCH_TOP_PLAYERS } from './actionType';

const initialState = {
    topPlayers: [{
       // id : '1', 
       // nickname : 'dioporcoschifoso'
    }],
    latestPlayers: [{

    }]
};

const playersReducers  = (state = initialState, action) => {
    console.log(action.payload)
    switch (action.type) {
        case FETCH_TOP_PLAYERS:
            return {
                ...state,
                topPlayers: action.payload
            }
        case FETCH_LATEST_PLAYERS:
            return {
                ...state,
                latestPlayers:action.payload
            }
        default:
            return state;
    }
}

export default playersReducers
